import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'; // Falls du eine Index-CSS-Datei verwendest
import App from './App';
import { createTheme, ThemeProvider } from '@mui/material/styles';

// Theme erstellen
const theme = createTheme({
    
  palette: {
    primary: {
      main: '#1976d2', // Blau als Hauptfarbe
    },
    secondary: {
      main: '#f50057', // Pink als Sekundärfarbe
    },
    background: {
      default: '#f5f5f5', // Heller Hintergrund
    },
    
    palette: {
        mode: 'dark',  // Setze auf 'light' für den normalen Modus
      },
  },
  typography: {
    fontFamily: 'Roboto, Arial, sans-serif', // Schriftarten
    h4: {
      fontSize: '2.5rem', // Schriftgröße für den Titel
      fontWeight: 'bold',
    },
    body1: {
      fontSize: '1rem', // Standard-Textgröße
    },
  },
});

ReactDOM.render(
  <React.StrictMode>
    <ThemeProvider theme={theme}>
      <App />
    </ThemeProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
